import './css/App.css';
import { useEffect, useState } from 'react';
import React from 'react';
import './components/Search.js';
import Search from './components/Search.js';
import SpotifySearch from './components/SpotifySearch.js';
import { SharedDataProvider } from './components/SharedDataContext';


function App() {
  const [data, setData] = useState(null);
  useEffect(() => {
    // Fetch the data from your Express server
    fetch('http://localhost:3001/api/data')
      .then((res) => res.json())
      .then((data) => setData(data.message))
      .catch((err) => console.error('Error fetching data:', err));
  }, []);
  return (
    <div>
      <header>
      <p id="title">Bookish Melodies</p>
      <nav>
        <ul>
          <li><a href="./components/Search.js">Search</a></li>
          <li><a href="./TopPlaylists.js">Top Playlists</a></li>
        </ul>
        </nav>
      </header>

      <main>
        <div className="title">
          <h1>Book-Inspired Playlist Generator</h1>
        </div>

        <button id="gen">Generate</button>
              <SharedDataProvider />
      </main>


      <footer>
        <p>&copy; 2023 Book-Inspired Playlist Generator</p>
      </footer>
    </div>
  );
}

export default App;
